import React from 'react';

const MemeTile = () => (
  <div className="meme__tile">
    <div className="meme__tile__image">
      <img src="" alt="" />
    </div>
    <div className="meme__tile__info">
      <h3>#4356</h3>
      <p>Backed by 4.5ETH</p>
      <button type="button">
        Caption
      </button>
    </div>
  </div>
);

export default MemeTile;
